    grid: {
      width: "100%",
      margin: "0px",

    },

    avatar: {
      backgroundColor: theme.palette.primary.main,
    },

    h1: {
      fontSize: "1.3rem",
    },
  })
);


const UserItem = ({user}: userProps) => {

    const classes = useStyle();

    return (
        <div>
            <Button size="large" variant="contained">
              <p> {user.data} </p>  
            </Button>

        </div>
    )
}

export default UserItem;
